import "owl.carousel/dist/assets/owl.theme.default.css";

import dynamic from 'next/dynamic';
const OwlCarousel = dynamic(import('react-owl-carousel'), {
    ssr: false
});


class Apps extends React.Component {
    state = {
        // responsive: {
        //     0: {
        //         items: 1
        //     }
        //     , 576: {
        //         items: 1
        //     }
        //     , 768: {
